    false,nt"url": null,nt"notes": "This narrative report for Upper Souris
    National Wildlife Refuge outlines Refuge accomplishments from August through October
    of 1941. The narrative starts of with summarizing weather conditions. Wildlife-
    including migratory birds, upland game birds, furbearers, predators, rodents, and
    raptors- are included. The Refuge development and maintenance section discusses
    physical developments and plantings. The public relations section details recreational
